export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},UEK6TpS4FZ:{data:{id:741,attributes:{imdbId:"tt2044760",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjQyMzQxMDAxM15BMl5BanBnXkFtZTcwMzc1Njc1OA@@._V1_SX300.jpg",type:c,ratings:[],item_lang:{data:{id:1404,attributes:{title:"Culling Hens",plot:"A naive young farmhand stumbles upon a terrible scene after suspecting her husband of an affair. Unable to comprehend what she has seen, the woman resolves to confront her husband and discover what happens in the stables at night.",slug:"culling-hens"}}},books:{data:[{id:4784,attributes:{title:g,description:h,thumbnail:i,authors:[a],firstBook:true,published:j,publisher:k,subtitle:b}},{id:4785,attributes:{title:g,description:h,thumbnail:i,authors:[a],firstBook:d,published:j,publisher:k,subtitle:b}},{id:4786,attributes:{title:"Ciara",description:"'I'm taking your eyes', he'd say, 'and keeping them safe.' 'I'm taking your ears and keeping them safe.' Ciara's father Mick kept her as his hidden treasure, making sure his only daughter was shielded from what he did and the men and women with whom he associated. Now Mick is dead and his legacy, so bound up in the landscape of Glasgow, that infamous no mean city, must be faced. As Ciara seeks to further the reputation of her art gallery, her world starts to fragment. Marked by the deep contradictions of her father, the art world and the place that made them all, she stands on a threshold. By confronting the past, her future blows wide open. Ciara by David Harrower premiered at the Traverse Theatre, Edinburgh, in August 2013.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hSpLAQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2013-08-29",publisher:l,subtitle:b}},{id:4787,attributes:{title:"A Slow Air",description:"Morna works as a cleaner in Edinburgh. She spends her time drinking, attempting affairs and trying to work out the mind of the twenty-year-old son with whom she shares her flat. Her elder brother, Athol, lives near Glasgow airport with his wife. The owner of a floor-tiling company, with two grown-up children, he's proud of his hard-won achievements since moving west. Between them, they have differing memories of their upbringing and their parents and definite opinions about each other. But these are left unsaid because Morna and Athol haven't spoken a word to each other in fourteen years . . . When Morna's son Joshua travels to see his uncle, he sets off a remarkable and life-changing series of events. A Slow Air by David Harrower premiered at the Tron Theatre, Glasgow, in April 2011, and transferred to the Traverse Theatre as part of the Edinburgh Fringe Festival.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QJAl5n7pTYMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2011-08-18",publisher:l,subtitle:b}},{id:4788,attributes:{title:"Kill The Old, Torture Their Young",description:"Kill the Old Torture their Young is an urban tragi-comedy from the acclaimed writer of Knives in Hens, one of Scotland's most talented new playwrights A documentary maker returns to the city of his birth. His task, to film his impressions. An old man remembers a time when eagles flew over the city. A TV executive reaches breaking point in the city he loves. A struggle actor seeks fame in a city that doesn't seem to want him. A young woman ends her artistic dreams in a city that eludes her. A receptionist tries to break the mould of her life in the city where she's always lived. A rock star sings to himself in a city he's forgotten the name of...Each of them has a story to tell, but who will listen?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6GSJAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2014-02-03",publisher:"A&C Black",subtitle:b}}]}}},meta:{}}},prerenderedAt:1681377274922}}("David Harrower","","movie",null,"series",1,"Knives in Hens","'I have no name for the thing which is in my head. It is not envy. It is more than envy. It does not scare me. I must look close enough to look at what it is.' A ploughman and his wife live a simple existence in a pre-industrial time until they, along with the hated local miller, are drawn into a struggle of knowledge, power and attraction. David Harrower's haunting play established him as one of the UK's leading contemporary playwrights. This new edition is published to coincide with the new production of this tense modern classic at the Donmar Warehouse in August 2017, directed by YaÃ«l Farber.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0Co4DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2017-10-26","Bloomsbury Publishing","Faber & Faber"))